import React, { Component } from 'react';

export default class Landing extends Component {
  render() {
    return (
      <div className="landing">
        <div className="header">
          <h1>
            Hi, I'm Ramzi El-Ramahi. <br />I'm a full-stack web developer.
          </h1>
        </div>
      </div>
    )
  }
}
